
function check_sysctl {
    # Completely purge whitespace
	val=$(sysctl -n ${1} | sed -e 's/[ \t]\{1,100\}//g')
	exp=$(echo "${2}" | sed -e 's/[ \t]\{1,100\}//g')
	if [ "${val}" !=  "${exp}" ]
	then
		printf 'inconsistent: For value sysctl value <font color=red>%36s</font>. On Record: \"%24s\" Found: \"%24s\"\n' "${1}" "${exp}" "${val}"
	fi
}



